import React from "react";
import "./App.css";
import Display from "./Display";
import Button from "./Button";
import Author from "./Author";

class App extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return(
            <div className="container outer-container">
                <Display />
                <Button />
                <Author />
            </div>
        );
    }
}

export default App;
